// Reviews.js

import React from 'react';

// BuyerReview component as an arrow function
  const BuyerReview = () => {
  return (
      <>
      <h1> Buyer Review </h1> 
      
      </>
      
  );
};

// SellerReview component as an arrow function
 const SellerReview = () => {
  return (
    <>
      <h3>Seller Review</h3>
      <p>This is a review from a happy seller.</p>
    </>
  );
};

export { BuyerReview, SellerReview };
